class CategoryNode {
  final String slug;
  final String name;
  final String icon;
  final List<CategoryNode> children;

  const CategoryNode({
    required this.slug,
    required this.name,
    this.icon = '',
    this.children = const [],
  });

  bool get isLeaf => children.isEmpty;
}

// ‚îÄ‚îÄ‚îÄ Yardƒ±mcƒ± fonksiyonlar ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ

CategoryNode? findNode(String slug, [List<CategoryNode>? nodes]) {
  final list = nodes ?? categoryTree;
  for (final node in list) {
    if (node.slug == slug) return node;
    final found = findNode(slug, node.children);
    if (found != null) return found;
  }
  return null;
}

List<CategoryNode>? findPath(String slug, [List<CategoryNode>? nodes, List<CategoryNode>? path]) {
  final list = nodes ?? categoryTree;
  for (final node in list) {
    final newPath = <CategoryNode>[...(path ?? []), node];
    if (node.slug == slug) return newPath;
    final found = findPath(slug, node.children, newPath);
    if (found != null) return found;
  }
  return null;
}

