String _s(String base, String name) {
  final suffix = name
      .toLowerCase()
      .replaceAll(RegExp(r'[^a-z0-9ƒü√º≈üƒ±√∂√ß]'), '-')
      .replaceAll(RegExp(r'-+'), '-')
      .replaceAll(RegExp(r'^-|-$'), '');
  return '$base-$suffix';
}

List<CategoryNode> _leaves(String parent, List<String> names) =>
    names.map((n) => CategoryNode(slug: _s(parent, n), name: n)).toList();

